import React, {Component} from "react"
import {connect} from "react-redux"
import classNames from "classnames"
export const mytest = () => {
  console.log('ss');
}
export default class Test extends Component {
  constructor(props) {
    super(props);
  }
  componentWillMount() {
    mytest()
  }
  componentDidMount() {}
  componentWillReceiveProps(nextProps) {}
  componentDidUpdate() {}
  componentWillUnmount() {}

  render() {
    return (<div>ss</div>)
  }
}
